var artifactId = Get<Guid>("SrmArtifact");

var select = new Select(UserConnection)
	.Column(Func.Sum("MaxPeriod"))
	.From(new Select(UserConnection)
		.Column("SrmPriorityApproval")
		.Column(Func.Max("SrmApprovalPeriod")).As("MaxPeriod")
		.From("SrmArtifactMatching")
		.Where("SrmArtifactId")
		.IsEqual(Column.Parameter(artifactId))
		.GroupBy("SrmPriorityApproval")
	).As("Q")
	as Select;

var artifactApprovalPeriod = select.ExecuteScalar<int>();
Set("SrmArtifactApprovalPeriod", artifactApprovalPeriod);

return true;

var helper = ClassFactory.Get<SrmApprovalServiceHelper>(new ConstructorArgument("userConnection", UserConnection));
var artifactId = Get<Guid>("SrmArtifact");
var recordId = helper.GetArtifactApprovalObjectRecordId(artifactId);
Set("SrmRecordId", recordId);
return true;

