/// <summary>
/// Расчитывает срок по календарю рабочих дней.
/// </summary>
/// <param name="date">Дата.</param>
/// <param name="term">Срок.</param>
/// <returns>Срок по календарю рабочих дней.</returns>
private DateTime GetTermByDate(DateTime date, int term)
{
	Core.Configuration.SysSettings.TryGetValue(UserConnection, "BaseUserCalendar", out var sysSettingsValue);

	var esq = new EntitySchemaQuery(UserConnection.EntitySchemaManager, "DayInCalendar");
	esq.RowCount = term;
	var dateColumn = esq.AddColumn("Date");
	dateColumn.OrderByDesc(0);
	esq.Filters.Add(esq.CreateFilterWithParameters(
	     FilterComparisonType.Equal, "DayType", SrmCoreConstantsCS.SrmDayTypeKeys.WorkingDay));
	esq.Filters.Add(esq.CreateFilterWithParameters(
	     FilterComparisonType.Equal, "Calendar", sysSettingsValue.ToString()));
	esq.Filters.Add(esq.CreateFilterWithParameters(
	     FilterComparisonType.Greater, "Date", date));

	var entities = esq.GetEntityCollection(UserConnection);

	if (entities.Count == 0){
		return DateTime.Now;
	}

	var maxDate = entities[0].GetTypedColumnValue<DateTime>("Date");
	return maxDate;
}
